import React from "react";
import "./AboutMe.css";

const AboutMe = () => {
  return (
    <section className="aboutContainer" id="about-me">
      <h2>About Me</h2>
      <p>Hi! I'm Navdeep Kaur, a web application developer with a passion for building creative and efficient solutions.</p>
    </section>
  );
};

export default AboutMe;
